  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:31.044403\",\n\t\"name\": \"adaptive-management-implementation-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Shrub communities provide critical habitat
  for regionally declining Neotropical migrants during both the breeding and post
  breeding season and New England cottontail, a Candidate Species with very limited
  distribution. Accordingly these habitats have been identified as high priority for
  many refuges in the Northeast. Shrub communities are also one of the most invaded
  habitats on most Refuges, and especially in the coastal zone. The ability of non-native
  invasive plant species to quickly colonize these habitats and their tenacious character,
  once established, has hampered our ability to meet habitat objectives for our trust
  resources. Lacking knowledge regarding successful and efficient techniques for managing
  shrubs with invasive plants or how to create new native shrublands, many biologists
  and managers choose to maintain the status quo.\",\n\t\"license_title\": \"License
